import "./app.css";
import React, { useEffect, useState } from "react";

function App() {
  const [count, setCount] = useState(0);

  return (
    <>
      <h1>{count}</h1>;
      <button onClick={(e) => setCount(count + 1)}>button</button>
    </>
  );
}

export default App;
